- input: "TEXT\x1CC00031088\x1C1\x1C\x1CF3XN\x1CThe memo entry on Schedule A, Line
    11(a)(i) from Susan Hutchison represents the advance of personal funds for non-travel
    expenses not yet reimbursed.  Because the total amount is less than $500 and has
    not been outstanding for 60 days, it is not a reportable debt as defined by 104.11(b).
    \ The reimbursement will be itemized on the appropriate FEC report. The debt owed
    on Schedule D, Line 10 to Susan Hutchison represents the advance of personal funds
    for travel expenses.  Due to the reimbursement timeframes described in 116.5,
    this does not need to be reported as a contribution on a Memo Schedule A.  The
    reimbursement and debt payment will be itemized on the appropriate report. The
    payments on H4 for communications consulting on 4/15/14 and 4/30/14 were for general
    party communications and do not refer to candidates for federal office or meet
    the definition of Federal Election Activity in 100.24. The payments on H4 for
    Employer IRA contributions were for employees who spent less than 25% of their
    time on FEA in April.  No employee whose salary or benefits appears on schedule
    H-4 spent more than 25% of their time on Federal Election Activity this month.
    Furthermore, there were no employees who spent more than 25% of their time on
    FEA this month.  When an employee does spend more than 25% of their time on FEA,
    their salary will be properly disclosed on Line 30(b) and paid entirely with federal
    funds. Additionally, utilities are included in the Committee's rent payments.\n"
